

let ups = JSON.parse(localStorage.getItem("profile"));
 let x=ups.firstName;
 let y=ups.lastName;
let box = document.createElement("div");
box.className="box";

let image = document.createElement("img");
image.className="limg";
image.src = "data:image/png;base64,";
image.style.width="100px";
image.style.height="100px";
image.style.display="block";
image.style.marginLeft="60px";
let but =  document.createElement("button");
but.innerText="MY PROFILE";
but.className="profilebut";
but.addEventListener("click",function(){
    profileFun(ups);
});
let names = document.createElement("p");
names.innerText=`${x} ${y}`;
names.style.marginBottom="10px";
let hr = document.createElement("hr");
hr.style.marginBottom="10px";
let email = document.createElement("p");
email.innerText=ups.email;
email.style.marginBottom="10px";
let mob =  document.createElement("p");
mob.innerText = ups.mobile;

box.append(image,but,names,hr,email,mob);
document.querySelector("#pleft").append(box);


